export const styles = {
    '*' : {
        boxSizing: 'border-box'
    },
    body : {
        width: '100%',
        height: '100%',
        margin: 0,
    },
    ul : {
        listStyle: 'none'
    },
    li : {
        listStyle: 'none'
    }

}
